import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function ConsentPage() {
  const navigate = useNavigate();
  const [allAgreed, setAllAgreed] = useState(false);
  const [agreements, setAgreements] = useState({
    terms: false,
    privacy: false,
    sensitive: false
  });

  const handleToggle = (key) => {
    const updated = { ...agreements, [key]: !agreements[key] };
    setAgreements(updated);
    const allChecked = Object.values(updated).every(Boolean);
    setAllAgreed(allChecked);
  };

  const handleAllToggle = () => {
    const newValue = !allAgreed;
    setAllAgreed(newValue);
    setAgreements({
      terms: newValue,
      privacy: newValue,
      sensitive: newValue
    });
  };

  const handleComplete = () => {
    if (agreements.terms) {
      navigate("/modeselection");
    } else {
      alert("필수 약관에 동의해주세요.");
    }
  };

  const openPolicy = (type) => {
    const urls = {
      terms: "https://www.example.com/terms",
      privacy: "https://www.example.com/privacy",
      sensitive: "https://www.example.com/sensitive"
    };
    window.open(urls[type], "_blank");
  };

  return (
    <div style={{ backgroundColor: "black", minHeight: "100vh", padding: "2rem", color: "white" }}>
      <div style={{
        backgroundColor: "white",
        color: "black",
        borderRadius: "1rem",
        padding: "2rem",
        maxWidth: "500px",
        margin: "auto"
      }}>
        <h2 style={{ fontWeight: "bold" }}>약관 동의가 필요합니다.</h2>
        <p style={{ color: "#666", fontSize: "0.9rem", marginBottom: "1rem" }}>
          ⚠ 선택 항목 동의 없이 이용 가능하나,<br />
          최종 결과물이 제공되지 않을 수 있습니다.
        </p>

        <label style={{ display: "flex", alignItems: "center", marginBottom: "1rem", fontWeight: "bold" }}>
          <input
            type="checkbox"
            checked={allAgreed}
            onChange={handleAllToggle}
            style={{ marginRight: "0.5rem" }}
          />
          모두 동의
        </label>

        <div style={{ borderTop: "1px solid #eee", paddingTop: "1rem" }}>
          <ConsentItem
            label="(필수) 서비스 이용약관 동의"
            checked={agreements.terms}
            onChange={() => handleToggle("terms")}
            onView={() => openPolicy("terms")}
          />
          <ConsentItem
            label="(선택) 개인정보 처리방침 동의"
            checked={agreements.privacy}
            onChange={() => handleToggle("privacy")}
            onView={() => openPolicy("privacy")}
          />
          <ConsentItem
            label="(선택) 민감정보 수집 및 이용 동의"
            checked={agreements.sensitive}
            onChange={() => handleToggle("sensitive")}
            onView={() => openPolicy("sensitive")}
          />
        </div>

        <div style={{ textAlign: "center", marginTop: "2rem" }}>
          <button
            onClick={handleComplete}
            style={{
              backgroundColor: "black",
              color: "white",
              padding: "1rem 2rem",
              borderRadius: "12px",
              fontSize: "1rem",
              cursor: "pointer"
            }}
          >
            동의 완료
          </button>
        </div>
      </div>
    </div>
  );
}

function ConsentItem({ label, checked, onChange, onView }) {
  return (
    <div style={{
      display: "flex",
      alignItems: "center",
      justifyContent: "space-between",
      marginBottom: "1rem"
    }}>
      <label style={{ display: "flex", alignItems: "center" }}>
        <input
          type="checkbox"
          checked={checked}
          onChange={onChange}
          style={{ marginRight: "0.5rem" }}
        />
        {label}
      </label>
      <button onClick={onView} style={{ fontSize: "0.9rem", color: "#888", background: "none", border: "none", cursor: "pointer" }}>
        보기
      </button>
    </div>
  );
}

export default ConsentPage;
